import React from "react";
import SongListTestB from "./components/SongListTestB";
import "./styles.css";

class App extends React.Component {
  render() {
    return (
      <div className="App">
        <header className="App-header">
          <h1>React</h1>
          <SongListTestB />
        </header>
      </div>
    );
  }
}

export default App;
